import Head from "next/head";

import { Container, Jumbotron, Form, FormGroup } from "reactstrap";

import Menu from "../components/Menu";

function Contato() {
  return (
    <>
      <Head>
        <title>Contato - Celke</title>
        <meta name="description" content="Contato com a empresa..." />
      </Head>

      <Menu />

      <Jumbotron fluid className="descr-top">
        <style>
          {`.descr-top{
              background-color: #000;
              color: #fed136;
              padding-top: 100px;
              padding-bottom: 50;
              margin-bottom: 0rem !important;

            }
            `}
        </style>
        <Container className="text-center">
          <h1 className="display-4">Contato</h1>
        </Container>
      </Jumbotron>

      <Jumbotron>
        <Container>
          <Form>
              <FormGroup>
                <label for="name">Nome</label>
                <input type="email" name="email" id="name" placeholder="Nome completo" />
              </FormGroup>
          </Form>
        </Container>
      </Jumbotron>

    </>
  );
}

export default Contato;
